tables.table_schema:
CREATE TABLE financial_data (
    client_id INT PRIMARY KEY,
    financial_goal VARCHAR(100),
    investment_preferences VARCHAR(150),
    FOREIGN KEY (client_id) REFERENCES clients(client_id)
);

CREATE TABLE clients (
    client_id INT PRIMARY KEY,
    client_name VARCHAR(255),
    client_age INT,
    client_email VARCHAR(255)
);

CREATE TABLE financial_goals (
    goal_id INT PRIMARY KEY,
    client_id INT,
    goal_description TEXT,
    goal_status VARCHAR(50)
);

CREATE TABLE investment_preferences (
    preference_id INT PRIMARY KEY,
    client_id INT,
    risk_tolerance VARCHAR(50),
    investment_style VARCHAR(50)
);

CREATE TABLE wealth_management (
    management_id INT PRIMARY KEY,
    client_id INT,
    management_type VARCHAR(50),
    management_fee DECIMAL(10,2)
);
